import React from "react";

const foodList = [
  { id: 1, name : "kimbap", img: "https://duckduckgo.com/?q=%EA%B9%80%EB%B0%A5.jpg&t=h_&iax=images&ia=images&iai=http%3A%2F%2Fimg.theqoo.net%2Fimg%2FsbTsW.jpg"},
  { id: 2, name : "bokkumbap", img: ""},
  { id: 3, name : "samgyupsal", img: ""},
]

function Food ({name, picture}) {
  return <div>I like {name}</div>
}

function renderFood (dish) {
  return <Food name={dish.name} />;
}

function App() {
  return ( 
    <div>
      {foodList.map(meal => (
        <Food key={meal.id} name={meal.name} />
      ))}
      {console.log(foodList.map(renderFood))}
    </div>
  );
}

export default App;
